import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import LandingPageNav from '../components/Navbars/LandingPageNav';
import landing from './landing.gif';
import { Link } from 'react-router-dom';
import { Container } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));



export default function LandingPage() {



  const classes = useStyles();

  return (
    <React.Fragment>


<Container background='white'>
      <img src={landing} maxWidth />
      <div className={classes.root}>
      <ButtonGroup variant="text" color="primary" aria-label="text primary button group">
      <Link to='/login' style={{ textDecoration: 'none', color: 'white'}}><Button>Login</Button></Link>
      <Link to='/signup'  style={{ textDecoration: 'none', color: 'white' }}> <Button>Signup</Button></Link>

      </ButtonGroup>
</div>
</Container>
    </React.Fragment>
  );
}
